import "./Main.css";
import Vinay from "../../../asstes/person.png";
import { Opacity } from "@mui/icons-material";
import { duration } from "@mui/material";

const textVariants = {
  initial: {
    x: -500,
    opacity: 0,
  },
  animate: {
    x: 0,
    opacity: 1,
    transition: {
      duration: 1,
      staggerChildren: 0.1,
    },
  },
};
export const Section = () => {
  return (
    <div className="container1">
      <div className="container mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
        <div className="hero">
          <div className="hero_welcome">
            {" "}
            <b className="hero_title">Welcome To My World</b> <br />
            Hi I'm <b className="vinay_title">Dasari Vinay Reddy</b>
            <br />
            <b className="vinay_sub">a Developer ,Ui/Ux Designer</b>
          </div>
        </div>
        <div className="section">
          <div className="section__box">
            <div className="section__image">
              <img src={Vinay} alt="" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
